import { PRODUCT_DATA } from '../data/data-store';

import moduleName from '../components/list-item.component';

export async function getStaticProps(context) {

  return {
    props: { ...PRODUCT_DATA },
  };
  

}

const ShopPage = (props) => {

  const products = Object.values(props).slice(0, 6); 

  return (
    <div className='shop'>
      {products.map((item) => (
        <div className='item'>
          <img className="product-photo" src={item.productphotos[0]} alt={item.productName} />
          <h2 className="product-name">{item.productName}</h2>
        </div>
      ))}
    </div>
  );
};

export default ShopPage;
